import React from 'react'
import './Conference.css';
import Hero from './Home/Hero'

function Conference() {
    return (
        <section className='section conference'>
        <Hero />
        <div className='section'>
            <h2 className='section__title'>
                About Conference
            </h2>
        </div>
            
        </section>
    )
}

export default Conference
